        ui_mode = 2,
        voice = 0,
    },

    [321] = {
        chapter_last_action = "",
        content = "八门村？是那个以八门特色流派得名的武学圣地吗！重华听爷爷说过，世界上一切武学的基础都是从八门村传出，那里曾经出现过非常多的大人物。可不知道什么原因基础武学失传，没想到竟然在帝都遇到了。",
