        ui_mode = 2,
        voice = 0,
    },

    [1098] = {
        chapter_last_action = "",
        content = "矿石之城因出产矿物而闻名，过去这里也就是个没有名字的小镇。百年前，我的祖父因为看中这里艰苦的修行环境，修建了武馆，传到我这刚好第三代。",
        dialog_id = 10100,
        dialogue_hide_action = "",
        finish_event = "",
        is_chapter_dialogue = 0,
        last_action = {},
        next = "5",
        pre_id_list = "5016,0",
        social_action_list = "",
        spine_ani_list = "",
        status = 2,
        sub_talker_list = "",
        subid = 4,
        type = 5,
        ui_mode = 2,
        voice = 0,
    },

    [1099] = {
        chapter_last_action = "",
        content = "因为环境艰苦居民们过去都是以石建房，没有想到在山里挖出了矿物。其中一种就是拥有药效的返生石，矿石之城也依靠售卖返生石变得风光无量，繁华程度不输帝都，不像现在许多人嫌弃这里都搬走了！",
        dialog_id = 10100,
        dialogue_hide_action = "",
        finish_event = "",
        is_chapter_dialogue = 0,
        last_action = {},
