        type = 4,
        ui_mode = 2,
        voice = 0,
    },

    [1101] = {
        chapter_last_action = "",
        content = "那时候嘟噜鸟也多，它们喜好干旱的地方，利爪能刨开岩层抓捕其中的动物食用。城里许多人把它驯化，卖给矿主作为脚力。从断魂崖到矿石之城到处都能看见它们的痕迹，吵得很！",
        dialog_id = 10100,
        dialogue_hide_action = "",
        finish_event = "",
        is_chapter_dialogue = 0,
