        ui_mode = 2,
        voice = 0,
    },

    [1775] = {
        chapter_last_action = "",
        content = "谢，谢谢你救了我，我们……好人啊。刚刚真的吓死我们了，今天去采石场上工的村民很多，村里根本找不到帮手！多谢几位大恩人！",
        dialog_id = 10153,
        dialogue_hide_action = "",
        finish_event = "",
        is_chapter_dialogue = 0,
        last_action = {},
        next = "3",
        pre_id_list = "5022,0",
        social_action_list = "",
        spine_ani_list = "",
        status = 1,
        sub_talker_list = "",
        subid = 10,
        type = 5,
        ui_mode = 2,
        voice = 0,
    },

    [1776] = {
        chapter_last_action = "",
        content = "我记得你之前在采石场想说什么却被打断了，现在能谈谈吗？",
        dialog_id = 10153,
        dialogue_hide_action = "",
        finish_event = "",
        is_chapter_dialogue = 0,
        last_action = {},
        next = "4",
        pre_id_list = "5022,0",
        social_action_list = "",
        spine_ani_list = "",
        status = 1,
        sub_talker_list = "",
        subid = 11,
        type = 4,
        ui_mode = 2,
        voice = 0,
    },

    [1777] = {
        chapter_last_action = "",
        content = "工头拦着我不敢说，但是恩人你问了我肯定要说。其实采石场也不太安全，妖族的力量多大人族根本没有办法反抗，所以石料的破损是不可避免的。",
        dialog_id = 10153,
        dialogue_hide_action = "",
        finish_event = "",
        is_chapter_dialogue = 0,
        last_action = {},
        next = "5",
        pre_id_list = "5022,0",
        social_action_list = "",
        spine_ani_list = "",
        status = 1,
        sub_talker_list = "",
        subid = 12,
        type = 5,
        ui_mode = 2,
        voice = 0,
    },

    [1778] = {
        chapter_last_action = "",
        content = "这种情况有向统帅部报告过吗？",
        dialog_id = 10153,
        dialogue_hide_action = "",
        finish_event = "",
        is_chapter_dialogue = 0,
        last_action = {},
        next = "6",
        pre_id_list = "5022,0",
        social_action_list = "",
        spine_ani_list = "",
        status = 1,
        sub_talker_list = "",
        subid = 13,
        type = 4,
        ui_mode = 2,
        voice = 0,
    },

    [1779] = {
        chapter_last_action = "",
        content = "老实跟你说，我们早说过了，统帅部也派过人来。像今天，你们也赶走了妖族可他们还是会再来的。",
        dialog_id = 10153,
        dialogue_hide_action = "",
        finish_event = "",
        is_chapter_dialogue = 0,
        last_action = {},
        next = "7",
        pre_id_list = "5022,0",
        social_action_list = "",
        spine_ani_list = "",
        status = 1,
        sub_talker_list = "",
        subid = 14,
        type = 5,
        ui_mode = 2,
        voice = 0,
    },

    [1780] = {
        chapter_last_action = "",
        content = "妖族总是来袭击断魂崖？",
        dialog_id = 10153,
        dialogue_hide_action = "",
        finish_event = "",
        is_chapter_dialogue = 0,
        last_action = {},
        next = "8",
        pre_id_list = "5022,0",
        social_action_list = "",
        spine_ani_list = "",
        status = 1,
        sub_talker_list = "",
        subid = 15,
        type = 4,
        ui_mode = 2,
        voice = 0,
    },

    [1781] = {
        chapter_last_action = "",
        content = "听说矿石之城也不安全。我们觉得只要是偏远的地区，妖族就会来攻击人族。果然，人族就不应该心慈手软让妖族收到和人族一样的待遇！不信你问我们村长！",
        dialog_id = 10153,
        dialogue_hide_action = "",
        finish_event = "DONE",
        is_chapter_dialogue = 0,
        last_action = {},
        next = "0",
        pre_id_list = "5022,0",
        social_action_list = "",
        spine_ani_list = "",
        status = 1,
        sub_talker_list = "",
        subid = 16,
        type = 5,
        ui_mode = 2,
        voice = 0,
    },

    [1782] = {
        chapter_last_action = "",
        content = "您好，请问您就是这个村子的村长吗？",
        dialog_id = 10154,
        dialogue_hide_action = "",
        finish_event = "",
        is_chapter_dialogue = 0,
