        ui_mode = 2,
        voice = 0,
    },

    [1783] = {
        chapter_last_action = "",
        content = "不错，年轻人刚刚你为什么要把那个邪恶的妖族放走，你是否听到了妖族的语言？",
        dialog_id = 10154,
        dialogue_hide_action = "",
        finish_event = "",
