        ui_mode = 2,
        voice = 0,
    },

    [1785] = {
        chapter_last_action = "",
        content = "噢，原来是我误会了。传说有一些比较特殊的人，他们能够听到妖族的语音，与妖族沟通甚至打败大妖。",
