        spine_ani_list = "",
        status = 2,
        sub_talker_list = "",
        subid = 3,
        type = 5,
        ui_mode = 2,
        voice = 0,
    },

    [2635] = {
        chapter_last_action = "",
        content = "……对。精神能力者到底是什么，他是人族，为什么从来没有听说过？",
        dialog_id = 10228,
        dialogue_hide_action = "",
        finish_event = "",
        is_chapter_dialogue = 0,
        last_action = {},
        next = "5",
        pre_id_list = "11201,0",
